import React, { useEffect, useState } from 'react'
import './style.css'

import { connect } from 'react-redux'
import { getData } from '../../main_redux/actions/server_connections'
import { indexProducts, indexSales } from '../../main_redux/actions/products'

const SaleHistory = (props) => {

  useEffect(() => {
    props.set('sales', indexSales)
    props.set('products', indexProducts)
  }, []);

  console.log(props.users)

  return(
    <div className="enter_window">

    </div>
  )
}

export default connect(
  state => ({
    users: state.users.users,
  }),
  dispatch => ({
    set: (path, setter) => dispatch(getData(path, setter))
  })
)(SaleHistory)
